// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import StudentLoginPage from './StudentLoginPage';
import RecruiterLoginPage from './RecruiterLoginPage';
import CoordinatorLoginPage from './CoordinatorLoginPage';
import StaffLoginPage from './StaffLoginPage';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/student" component={StudentLoginPage} />
        <Route path="/recruiter" component={RecruiterLoginPage} />
        <Route path="/coordinator" component={CoordinatorLoginPage} />
        <Route path="/staff" component={StaffLoginPage} />
      </Switch>
    </Router>
  );
}

export default App;
